import Card from "./Card"
import {edudata, expdata} from "./cvdata"

export default function CV() {
    const eduCardElements = edudata.map(data => {
        return <Card data={data} />
    })
    const expCardElements = expdata.map(data => {
        return <Card data={data} />
    })

    return (
        <div className="main--cv-div">
            <div className="main--h3-div">
                <i className="main--cv-faw fa-solid fa-graduation-cap" />
                <h3><b>Utbildning</b></h3>
            </div>
            {eduCardElements}
            <div className="main--h3-div">
                <i className="main--cv-faw fa-solid fa-folder-open" />
                <h3><b>Erfarenhet</b></h3>
            </div>
            {expCardElements} 
        </div>
    )
}
